    false,nt"url": null,nt"notes": "This layer represents the watershed regulation
    areas inside the extent of the City of Austin's jurisdiction. The Barton Creek Watershed
    Ordinance introduced stream set back requirements that created five water quality
    zones with enumerated development restrictions for each one. The ordinance also
    provided incentives (increased density) for the transfer of development rights that
    included the conveyance of land in the critical water quality zone, for water quality
    protection, to the ped. This product is for informational purposes and may not have
    been prepared for or be suitable for legal, engineering, or surveying purposes.
    It does not represent an on-the-ground survey and represents only the approximate
    relative location of property boundaries. This product has been produced by the
    Communications and Technology Management Department for the sole purpose of geographic
    reference. No warranty is made by the City of Austin regarding specific accuracy
    or completeness.",nt"license_title": "License Not Specified",nt"extras":
